*,
*::after,
*::before {
	margin: 0;
	padding: 0;
	box-sizing: inherit;
}

html {
	box-sizing: border-box;
	font-size: 50%;
	/** 8px **/
}

body {
	font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
	font-weight: 400;
	line-height: 1.6;
	-webkit-font-smoothing: antialiased;
	-moz-osx-font-smoothing: grayscale;
}

li {
	list-style: none;
}

a {
	text-decoration: none;
}


/**********************************
*
*    MEDIA QUERIES
*
***********************************/



/* HEADER */

.header {
  position: fixed;
  top: 0;
  left: 0;
  background-color: #EDF2F4;
  width: 100%;
  height: 8vh;
  z-index: 50;
}

.navigation__list {
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  height: 100%;
  padding: 1rem 1rem;
}

.navigation__list-link {
  position: relative;
  font-size: 1.6rem;
  font-weight: 400;
  color: #050505;
  transition: all .4s ease-out;
}

.navigation__list-link:hover::after {
  content: '';
  position: absolute;
  left: -10%;
  bottom: -.8rem;
  display: block;
  width: calc(100% + 20%);
  height: 2px;
  background-color: #050505;
}



/* ABOUT */

.about {
  padding: 13vh 1rem 1rem 1rem;
  margin-bottom: 4rem;
}

.about__title--primary {
  font-size: 2.6rem;
  color: #050505;
  line-height: 1.2em;
  font-weight: 800;
  margin-bottom: 2rem;
  text-align: center;
}

.about__title--secondary {
  font-size: 2.2rem;
  font-weight: 600;
  color: #5C9EAD;
  text-align: center;
}

/* PRESENTATION */

.presentation {
  padding: 4rem 1rem;
  background-color: #EDF2F4;
  margin-bottom: 4rem;
}

.presentation__title--primary {

  font-size: 2.6rem;
  font-weight: 700;
  text-align: center;
  color: #050505;
  margin-bottom: 1.4rem;
}

.presentation__content-container {

}

.presentation__content {
  font-size: 1.6rem;
  line-height: 1.4em;
  text-align: center;
  color: #050505;
}

/* PROFILE */

.profile {
  padding: 4rem 1rem;
  margin-bottom: 2rem;
}

.profile__article {
  background-color: rgba(237,242,244, 1);
  padding: 3rem 2rem;
  margin-bottom: 4rem;
}

.profile__image-container {
  width: 100%;
  height: auto;
  text-align: center;
  margin-bottom: 1.4rem;
}

.profile__image {
  width: 14rem;
  height: 14rem;
  border-radius: 100rem;
  border: 2px solid #050505;
}

.profile__title {
  font-size: 2rem;
  color: #050505;
  text-align: center;
}

.profile__job {
  font-size: 1.8rem;
  color: #050505;
  text-align: center;
  margin-bottom: 1.6rem;
}

.profile__expertise {
  font-size: 1.6rem;
  color: #5C9EAD;
  text-align: center;
  margin-bottom: 1.6rem;
}

.profile__expertise--span{
  color: #050505;
}

.profile__link-container {
  display: flex;
  justify-content: center;
  align-items: center;
}

.profile__link-contact {
  font-size: 1.6rem;
  color: #F5F5F5;
  font-weight: 500;
  padding: 1.2rem 2.4rem;
  border: none;
  border-radius: 4px;
  margin-right: 1rem;
  background-color: #91ADC2;
}

.profile__link-profile {
  font-size: 1.6rem;
  color: #F5F5F5;
  font-weight: 500;
  padding: 1.2rem 2.4rem;
  border: none;
  border-radius: 4px;
  margin-left: 1rem;
  background-color: #5C9EAD;
}


/* SERVICES */

.services {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 4rem 2rem;
  background-color: #5C9EAD;
  margin-bottom: 4rem;
}

.services__wrapper {
  margin-bottom: 6rem;
}

.services__title--primary {
  position: relative;
  font-size: 2.6rem;
  font-weight: 800;
  text-align: center;
  color: #F5F5F5;
  margin-bottom: 3.6rem;
}

.services__title--primary::after {
  content: '';
  display: block;
  position: absolute;
  bottom: -2.1rem;
  left: 50%;
  width: 6rem;
  height: .2rem;
  transform: translateX(-50%);
  background-color: #F5F5F5;
}

.services__container {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

.services__title--secondary {
  font-size: 2rem;
  color: #F5F5F5;
  text-align: center;
  margin-bottom: 1.4rem;
}

.services__content {
  font-size: 1.6rem;
  color: #F5F5F5;
  text-align: center;
  margin-bottom: 2rem;
}

.services__link {
  font-size: 2rem;
  font-weight: 600;
  background-color: #F5F5F5;
  color: #5C9EAD;
  padding: 1rem 2rem;
  border-radius: 4px;
  border: none;
}

/* Gallery */

.gallery {
  padding: 4rem 1rem;
  margin-bottom: 2rem;
  background-color: #EDF2F4;
}

.gallery__container {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 2rem;
}

.gallery__image-container {
  width: 48%;
  height: 14rem;
}

.gallery__image {
  width: 100%;
  height: 100%;
}


/* FOOTER */

.footer {
  padding: 2rem 1rem 4rem;
}

.footer__title {
  font-size: 2rem;
  color: #050505;
  line-height: 1.2em;
  font-weight: 700;
  text-align: center;
  margin-bottom: 2rem;
}

.footer__address {
  font-size: 1.6rem;
  color: #050505;
  margin-bottom: 1rem;
  text-align: center;
}

.footer__copyright {
  font-size: 1.6rem;
  color: #050505;
  text-align: center;
}

.footer__copyright-link {
  font-size: 1.6rem;
  font-weight: 500;
  color: #83C9F4;
}


/* Mobile - 375px to 424px */


@media only screen and (min-width: 23.4375em) {

.navigation__list {
  padding: 1rem 2rem;
}


}

/* Large Mobile - 550 to 1023px */

@media only screen and (min-width: 34.375em) {

  .navigation__list {
    padding: 2rem 4rem;
  }

  .services__title--primary {
    margin-bottom: 5.6rem;
  }


  .gallery {
    padding: 4rem 2rem;
  }

.gallery__container {

  margin-bottom: 3rem;
}

.gallery__image-container {
  width: 48%;
  height: 25rem;
}

}

/* Tablet - 768px to 1023px */
/** 1rem = 9px **/


@media only screen and (min-width: 48em) {
	html {
		font-size: 56.25%;
		/** 9px **/
  }

}

/* Small Desktop - 1024px to 1199px */

/** 1rem = 10px **/


@media only screen and (min-width: 64em) {
	html {
		font-size: 62.5%;
  }

  .navigation__list {
    padding: 2rem 6rem;
  }

  .navigation__list-link {
    font-size: 1.8rem;
}

.about__title--primary {
  font-size: 3.6rem;
}

.about__title--secondary {
  font-size: 2.6rem;
}

.presentation__title--primary {
  font-size: 3.6rem;
}

.presentation__content-container {
  padding: 1rem 2rem;
}

.presentation__content {
  font-size: 1.8rem;
  line-height: 1.4em;
}

.profile__title {
  font-size: 2.4rem;
}

.profile__job {
  font-size: 2rem;
}

.profile__expertise {
  font-size: 1.8rem;
  margin-bottom: 2rem;
}

.services__title--primary {
  margin-bottom: 5.6rem;
  font-size: 3.2rem;
}

.services__title--secondary {
  font-size: 2.4rem;
}

.services__content {
  font-size: 1.8rem;
  line-height: 1.4em;
  margin-bottom: 3rem;
}

.services__link {
  font-size: 2.2rem;
}

.gallery {
  padding: 4rem 3rem;
}

.gallery__container {

margin-bottom: 4rem;
}

.gallery__image-container {
  width: 48%;
  height: 28rem;
}

.footer__title {
  font-size: 2.8rem;
}

.footer__address {
  font-size: 2rem;
}

.footer__copyright {
  font-size: 2rem;
}

}

/* Desktop - 1200px to 1399px */

@media only screen and (min-width: 75em) {




  .gallery__image-container {
    width: 48%;
    height: 35rem;
  }

  .services__main-container {
    display: flex;
    justify-content: space-around;
    flex-wrap: wrap;
  }

  .services__wrapper {
    width: 40%;
    margin-bottom: 8rem;
  }


}

/* Big Desktop - 1399px to 1920px */

@media only screen and (min-width: 160em) {
	html {
		font-size: 75%;
  }

  .gallery__image-container {
    width: 48%;
    height: 40rem;
  }

}

